	public static String hasCity(String result) {
		for (int i = 0; i < CITY.length; i++) {
			for (int j = 0; j < CITY[i].length; j++) {
				if (CITY[i][j].equals(result)) {
					return PROVINCE[i] + "," + CITY[i][j] + "," + CITY_CODE[i][j];
				}
			}
		}
		return "";
	}


	public static String getCityByCode(String cityCode) {
		for (int i = 0; i < CITY_CODE.length; i++) {
			for (int j = 0; j < CITY_CODE[i].length; j++) {
				if (CITY_CODE[i][j].equals(cityCode)) {
					return CITY[i][j];
				}
			}
		}
		return "";
	}
			
	public static String getProvByCode(String cityCode) {
		for (int i = 0; i < CITY_CODE.length; i++) {
			for (int j = 0; j < CITY_CODE[i].length; j++) {
				if (CITY_CODE[i][j].equals(cityCode)) {
					return PROVINCE[i];
				}
			}
		}
		return "";
	}	
	
